import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Download, Printer, Mail, Phone, Github, Linkedin } from 'lucide-react';

const Resume = () => {
  const [ref, inView] = useInView({ threshold: 0.1 });

  const handlePrint = () => {
    window.print();
  };

  const handleDownload = () => {
    // Import html2pdf dynamically
    const script = document.createElement('script');
    script.src = 'https://cdnjs.cloudflare.com/ajax/libs/html2pdf.js/0.10.1/html2pdf.bundle.min.js';
    script.onload = () => {
      const element = document.querySelector('.resume-content');
      const opt = {
        margin: [0.5, 0.5, 0.5, 0.5],
        filename: 'Tyler_Jay_Perkins_Resume.pdf',
        image: { type: 'jpeg', quality: 0.98 },
        html2canvas: { 
          scale: 2,
          useCORS: true,
          letterRendering: true
        },
        jsPDF: { 
          unit: 'in', 
          format: 'letter', 
          orientation: 'portrait' 
        },
        pagebreak: { 
          mode: ['avoid-all', 'css', 'legacy'],
          before: '.page-break-before',
          after: '.page-break-after'
        }
      };

      // Temporarily add PDF-specific classes
      element.classList.add('pdf-export');

      window.html2pdf().set(opt).from(element).save().then(() => {
        // Remove the temporary class
        element.classList.remove('pdf-export');
      });
    };
    document.head.appendChild(script);
  };

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <>
      <style jsx>{`
        .resume-section {
          min-height: 100vh;
          padding: 6rem 2rem 2rem;
          background: var(--bg-primary);
        }

        .resume-actions {
          display: flex;
          justify-content: center;
          gap: 1rem;
          margin-bottom: 2rem;
        }

        .action-button {
          display: flex;
          align-items: center;
          gap: 0.5rem;
          padding: 0.75rem 1.5rem;
          background: var(--accent-primary);
          color: white;
          border: none;
          border-radius: 25px;
          font-weight: 500;
          cursor: pointer;
          transition: all 0.3s ease;
        }

        .action-button:hover {
          background: var(--accent-secondary);
          transform: translateY(-2px);
        }

        .resume-content {
          max-width: 800px;
          margin: 0 auto;
          background: var(--bg-secondary);
          padding: 3rem;
          border-radius: 15px;
          box-shadow: 0 10px 30px var(--shadow);
        }

        .resume-header {
          text-align: center;
          margin-bottom: 3rem;
          padding-bottom: 2rem;
          border-bottom: 2px solid var(--border-color);
        }

        .resume-name {
          font-size: 2.5rem;
          font-weight: 700;
          color: var(--text-primary);
          margin-bottom: 1rem;
        }

        .contact-info {
          display: flex;
          justify-content: center;
          flex-wrap: wrap;
          gap: 1.5rem;
        }

        .contact-item {
          display: flex;
          align-items: center;
          gap: 0.5rem;
          color: var(--text-secondary);
          font-size: 0.9rem;
        }

        .contact-item svg {
          color: var(--accent-primary);
        }

        .contact-link {
          color: var(--accent-primary);
          text-decoration: none;
          transition: color 0.3s ease;
        }

        .contact-link:hover {
          color: var(--text-primary);
          text-decoration: underline;
        }

        .contact-text-screen {
          display: inline;
        }

        .contact-text-print {
          display: none;
        }

        .resume-section-content {
          margin-bottom: 2.5rem;
        }

        .section-title {
          font-size: 1.5rem;
          font-weight: 600;
          color: var(--accent-primary);
          margin-bottom: 1.5rem;
          padding-bottom: 0.5rem;
          border-bottom: 2px solid var(--accent-primary);
        }

        .education-item,
        .experience-item,
        .project-item {
          margin-bottom: 2rem;
        }

        .education-item h3,
        .experience-item h3,
        .project-item h3 {
          font-size: 1.2rem;
          font-weight: 600;
          color: var(--text-primary);
          margin-bottom: 0.5rem;
        }

        .item-details {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 0.75rem;
          flex-wrap: wrap;
          gap: 0.5rem;
        }

        .institution,
        .company {
          color: var(--text-secondary);
          font-weight: 500;
        }

        .date {
          color: var(--accent-primary);
          font-weight: 500;
          font-size: 0.9rem;
        }

        .project-link {
          display: flex;
          align-items: center;
          gap: 0.5rem;
          color: var(--accent-primary);
          font-size: 0.9rem;
          margin-bottom: 0.75rem;
        }

        .achievements,
        .responsibilities,
        .project-details {
          list-style: none;
          padding: 0;
        }

        .achievements li,
        .responsibilities li,
        .project-details li {
          position: relative;
          padding-left: 1.5rem;
          margin-bottom: 0.5rem;
          color: var(--text-secondary);
          line-height: 1.6;
        }

        .achievements li::before,
        .responsibilities li::before,
        .project-details li::before {
          content: "•";
          position: absolute;
          left: 0;
          color: var(--accent-primary);
          font-weight: bold;
        }

        .skills-content p {
          margin-bottom: 0.75rem;
          color: var(--text-secondary);
          line-height: 1.6;
        }

        .skills-content strong {
          color: var(--text-primary);
        }

        .container {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 2rem;
        }

        /* Print Styles */
        @media print {
          .no-print {
            display: none !important;
          }

          .resume-section {
            padding: 0;
            background: white !important;
            min-height: auto;
          }

          .resume-content {
            background: white !important;
            box-shadow: none !important;
            border-radius: 0 !important;
            padding: 0.75rem !important;
            margin: 0 !important;
            max-width: none !important;
          }

          .resume-header {
            margin-bottom: 1rem !important;
            padding-bottom: 0.75rem !important;
            border-bottom: 1px solid #ddd !important;
          }

          .resume-name {
            font-size: 1.6rem !important;
            color: #333 !important;
            margin-bottom: 0.5rem !important;
          }

          .contact-info {
            gap: 0.3rem !important;
            flex-direction: column !important;
            align-items: center !important;
          }

          .contact-item {
            color: #666 !important;
            font-size: 0.7rem !important;
            justify-content: center !important;
          }

          .contact-item svg {
            display: none !important;
          }

          .contact-text-screen {
            display: none !important;
          }

          .contact-text-print {
            display: inline !important;
          }

          .contact-link {
            color: #666 !important;
            text-decoration: none !important;
          }

          .section-title {
            color: #2563eb !important;
            font-size: 1.1rem !important;
            margin-bottom: 0.5rem !important;
            border-bottom: 1px solid #2563eb !important;
            padding-bottom: 0.2rem !important;
            margin-top: 0.75rem !important;
          }

          .education-item h3,
          .experience-item h3,
          .project-item h3 {
            color: #333 !important;
            font-size: 0.9rem !important;
            margin-bottom: 0.2rem !important;
          }

          .item-details {
            margin-bottom: 0.3rem !important;
            flex-direction: row !important;
            justify-content: space-between !important;
          }

          .institution,
          .company {
            color: #555 !important;
            font-size: 0.75rem !important;
          }

          .date {
            color: #2563eb !important;
            font-size: 0.75rem !important;
          }

          .project-link {
            color: #2563eb !important;
            font-size: 0.7rem !important;
            margin-bottom: 0.3rem !important;
          }

          .achievements,
          .responsibilities,
          .project-details {
            margin-bottom: 0.5rem !important;
          }

          .achievements li,
          .responsibilities li,
          .project-details li {
            color: #555 !important;
            font-size: 0.75rem !important;
            margin-bottom: 0.15rem !important;
            line-height: 1.3 !important;
            padding-left: 0.8rem !important;
          }

          .achievements li::before,
          .responsibilities li::before,
          .project-details li::before {
            color: #2563eb !important;
            left: 0 !important;
          }

          .skills-content p {
            color: #555 !important;
            font-size: 0.75rem !important;
            margin-bottom: 0.3rem !important;
            line-height: 1.3 !important;
          }

          .skills-content strong {
            color: #333 !important;
          }

          /* Critical page break fixes */
          .resume-section-content {
            margin-bottom: 0.75rem !important;
            page-break-inside: avoid !important;
            break-inside: avoid !important;
          }

          .education-item,
          .experience-item {
            page-break-inside: avoid !important;
            break-inside: avoid !important;
            margin-bottom: 0.5rem !important;
          }

          .project-item {
            page-break-inside: avoid !important;
            break-inside: avoid !important;
            margin-bottom: 0.75rem !important;
          }

          /* Ensure Personal Projects section doesn't break */
          .resume-section-content:nth-of-type(3) {
            page-break-before: auto !important;
            break-before: auto !important;
          }

          /* Force better spacing */
          .project-item:first-child {
            margin-top: 0 !important;
          }
        }

        /* PDF Export specific styles */
        .pdf-export {
          font-size: 14px !important;
        }

        .pdf-export .resume-header {
          margin-bottom: 1.2rem !important;
        }

        .pdf-export .section-title {
          margin-bottom: 0.8rem !important;
          margin-top: 1rem !important;
        }

        .pdf-export .project-item {
          margin-bottom: 1rem !important;
        }

        /* Mobile Responsive */
        @media (max-width: 768px) {
          .resume-section {
            padding: 5rem 1rem 2rem;
          }

          .resume-content {
            padding: 2rem 1.5rem;
          }

          .resume-name {
            font-size: 2rem;
          }

          .contact-info {
            flex-direction: column;
            align-items: center;
            gap: 0.75rem;
          }

          .item-details {
            flex-direction: column;
            align-items: flex-start;
          }

          .action-button {
            padding: 0.5rem 1rem;
            font-size: 0.9rem;
          }

          .container {
            padding: 0 1rem;
          }
        }
      `}</style>

      <section className="resume-section" ref={ref}>
        <div className="container">
          <motion.div
            className="resume-actions no-print"
            initial={{ opacity: 0, y: -20 }}
            animate={inView ? { opacity: 1, y: 0 } : { opacity: 0, y: -20 }}
            transition={{ duration: 0.6 }}
          >
            <motion.button
              className="action-button"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={handleDownload}
            >
              <Download size={20} />
              Download PDF
            </motion.button>
            <motion.button
              className="action-button"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={handlePrint}
            >
              <Printer size={20} />
              Print Resume
            </motion.button>
          </motion.div>

          <motion.div
            className="resume-content"
            variants={containerVariants}
            initial="hidden"
            animate={inView ? "visible" : "hidden"}
          >
            {/* Header */}
            <motion.header className="resume-header" variants={itemVariants}>
              <h1 className="resume-name">Tyler Jay Perkins</h1>
              <div className="contact-info">
                <div className="contact-item">
                  <Mail size={16} />
                  <a href="mailto:tylerjayp12@gmail.com" className="contact-link">
                    tylerjayp12@gmail.com
                  </a>
                </div>
                <div className="contact-item">
                  <Phone size={16} />
                  <span>801-699-3941</span>
                </div>
                <div className="contact-item">
                  <Linkedin size={16} />
                  <a 
                    href="https://www.linkedin.com/in/tylerjayperkins/" 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="contact-link"
                  >
                    <span className="contact-text-screen">LinkedIn</span>
                    <span className="contact-text-print">https://www.linkedin.com/in/tylerjayperkins/</span>
                  </a>
                </div>
                <div className="contact-item">
                  <Github size={16} />
                  <a 
                    href="https://github.com/TylerJayP" 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="contact-link"
                  >
                    <span className="contact-text-screen">GitHub</span>
                    <span className="contact-text-print">https://github.com/TylerJayP</span>
                  </a>
                </div>
              </div>
            </motion.header>

            {/* Education */}
            <motion.section className="resume-section-content" variants={itemVariants}>
              <h2 className="section-title">Education</h2>
              <div className="education-item">
                <h3>Bachelor of Science - Computer Science</h3>
                <div className="item-details">
                  <span className="institution">Utah Valley University, Orem, UT</span>
                  <span className="date">Expected Graduation: Spring 2026</span>
                </div>
              </div>
              <div className="education-item">
                <h3>Associate of Science - Computer Science</h3>
                <div className="item-details">
                  <span className="institution">Utah Valley University, Orem, UT</span>
                  <span className="date">Aug. 2023 - Aug. 2024, GPA 3.45</span>
                </div>
                <ul className="achievements">
                  <li>Awarded Certificate of Completion - Programmer (Aug 2024)</li>
                </ul>
              </div>
            </motion.section>

            {/* Experience */}
            <motion.section className="resume-section-content" variants={itemVariants}>
              <h2 className="section-title">Non-Technical Experience</h2>
              <div className="experience-item">
                <h3>Manager</h3>
                <div className="item-details">
                  <span className="company">K1Speed, Sandy, UT</span>
                  <span className="date">Dec 2023 - Current</span>
                </div>
                <ul className="responsibilities">
                  <li>Collaborate with upper management to analyze performance metrics and implement growth initiatives.</li>
                  <li>Manage customer concerns and escalations to ensure retention and guest satisfaction.</li>
                  <li>Assist in inventory management, sales tracking, and financial reporting.</li>
                  <li>Develop and execute targeted marketing strategies to increase customer acquisition.</li>
                </ul>
              </div>
            </motion.section>

            {/* Projects */}
            <motion.section className="resume-section-content" variants={itemVariants}>
              <h2 className="section-title">Personal Projects</h2>

              <div className="project-item">
                <h3>Personal Mood Journal Web Application</h3>
                <div className="project-link">
                  <Github size={14} />
                  <span>Repository: https://github.com/TylerJayP/MoodJournal</span>
                </div>
                <ul className="project-details">
                  <li>Developing a responsive mood tracking web application with photo upload capabilities and interactive data visualizations.</li>
                  <li>Implemented client-side state management using React Context API and Local Storage for data persistence.</li>
                  <li>Built a user interface featuring calendar views, filtering functionality, and real-time dashboard analytics.</li>
                  <li>Created an AI-powered mood insights feature to analyze user patterns and provide personalized recommendations.</li>
                  <li>Designed an authentication system with login/signup pages (frontend implementation complete).</li>
                  <li>Planned Enhancement: Backend development using C# ASP.NET with MySQL database for secure user authentication and persistent data storage.</li>
                </ul>
              </div>

              <div className="project-item">
                <h3>Rocket League AI Bot</h3>
                <ul className="project-details">
                  <li>Developing an autonomous Rocket League agent using RLGym, a Python reinforcement learning environment.</li>
                  <li>Training an AI bot to learn game mechanics, positioning, and strategic decision-making through reinforcement learning algorithms.</li>
                  <li>Implementing reward systems and training loops to optimize bot performance.</li>
                  <li>Exploring deep reinforcement learning techniques to create an agent capable of advanced Rocket League gameplay.</li>
                </ul>
              </div>
            </motion.section>

            {/* Technical Skills */}
            <motion.section className="resume-section-content" variants={itemVariants}>
              <h2 className="section-title">Technical Skills</h2>
              <div className="skills-content">
                <p>
                  <strong>Proficient with:</strong> C#, C++, HTML, CSS, JavaScript, React, and Git
